import Square from "./Square";

function Stats(props) {
  return (
    <div className={props.class}>
      <center>
        <Square color="#36e7f4" className="statSquare" id="firstStat" />
      </center>
      <div id="counters">
        <center><h2>{props.counter[0]}</h2></center>
        <center><h2>{props.counter[1]}</h2></center>
      </div>
      <center>
        <Square color="#f44336" className="statSquare" id="secondStat" />
      </center>
    </div>
  );
}

export default Stats;
